// sRGB to linear conversion function
float sRGBtoLinear(float c) {
    if (c <= 0.04045) {
        return c / 12.92;
    } else {
        return pow((c + 0.055) / 1.055, 2.4);
    }
}

void main() {
    vec4 texColor = texture(tex, texCoord); // Sample the texture color at the input texture coordinates
    vec3 linearColor = vec3(sRGBtoLinear(texColor.r), sRGBtoLinear(texColor.g), sRGBtoLinear(texColor.b)); // Convert the sampled color from sRGB to linear color space
